import React from 'react';
import ScriptTag from 'react-script-tag';
import Navbar from './_share/Navbar.js';
import Main_content from './_share/Main_content.js';
import Footer from './_share/Footer.js';
import '../../template/template_customer/fonts/icomoon/style.css'
import '../../template/template_customer/css/bootstrap.min.css'
import '../../template/template_customer/css/magnific-popup.css'
import '../../template/template_customer/css/jquery-ui.css'
import '../../template/template_customer/css/owl.carousel.min.css'
import '../../template/template_customer/css/owl.theme.default.min.css'
import '../../template/template_customer/css/aos.css'
import '../../template/template_customer/css/style.css'

const Customer_layout = ({ section }) => {
	return (
		<div className="site-wrap">
				<Navbar />
				<Main_content section={section} />
				<Footer />
		</div>
	)
}

export default Customer_layout
